import React from 'react'

const Trending = () => {
  return (
    <div class="py-6 px-4 sm:p-6 md:py-10 md:px-8 ">
        <div class="max-w-4xl mx-auto grid grid-cols-1 lg:max-w-6xl lg:gap-x-20 lg:grid-cols-2">
            <h1>Hola</h1>
        </div>
    </div>
  )
}

export default Trending
